import React from 'react';
import Logo from '../../../utils/img/rsz_logo.jpg';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import Button from '@material-ui/core/Button';

const Navbar = () => {
	return (
		<Container>
			<Grid container direction='row-reverse' justify='space-between' alignItems='center' style={{ padding: '10px 0' }}>
				<Grid item xs={3} container direction='row-reverse' alignItems='center'>
					<img src={Logo} alt='Logo' className='logo' />
					<Grid
						item
						xs={8}
						container
						direction='column'
						justify='center'
						alignItems='flex-end'
						style={{ marginRight: 20, color: '#2F6171' }}
					>
						<Grid item>جلب رضایت شما</Grid>
						<Grid item>مهمترین دغدغه‌ی ماست</Grid>
					</Grid>
				</Grid>
				<Grid item>
					<Button variant='outlined' style={{ marginRight: 5, color: '#2F6171' }}>
						ثبت نام
					</Button>
					<Button style={{ color: '#2F6171' }}>ورود</Button>
				</Grid>
			</Grid>
		</Container>
	);
};

export default Navbar;
